import { Component } from 'react';
import Room from './Room';
import axios from 'axios';

export default class Rooms extends Component {
    constructor(props) {
        super(props);
        this.state = { rooms: [] }

    }
    componentDidMount() {
        const requestOption = {
            method: 'GET',
            headers: { 'Content-Type': 'application/json' }
        }
        fetch('http://localhost:8000/getJoin/f13', requestOption)
            .then(res => res.json())
            .then(data => this.setState({ rooms: data }))

    }


    render() {
        if (this.state.r !== []) {

            return (

                <div className="row" >
                    {this.state.rooms.map(room => {
                        return (
                            <Room
                                code={room}
                            >
                            </Room>
                        )
                    })}

                </div>
            )
        }
    }
}
